const Plan = (props) => {
  return (
    <div className="wrapper">
      <div className="header">
        <div className="plan-image">
          <img src={props.image} />
        </div>
        <h3>{props.title}</h3>
      </div>
      <style jsx>{`
        .wrapper {
          display: flex;
          flex-direction: column;
        }

        .plan-image {
          display: flex;
          justify-content: center;
          width: 100%;
        }

        .plan-image img {
          width: 50%;
        }
      `}</style>
    </div>
  );
};

export default Plan;
